import React, { useState } from "react";
import { Link,  } from "react-router-dom";

export default function Register() {
  const [formValue, setFormValue] = useState({
    email: '',
    password: ''
  })

  const navigate = useNavigate();

  return(
    <div className="auth">
      <h2 className="auth__title">Регистрация</h2>
      <form className="auth__form">
        <input className="auth__input" type="text" placeholder="Email" />
        <input className="auth__input" type="password" placeholder="Пароль"/>
        <button className="auth__submit" type="submit">Зарегистрироваться</button>
      </form>
      <Link className="auth__link" to="/sign-in">Уже зарегистрированы? Войти</Link>
    </div>
  )
}
